import 'package:flutter/material.dart';
import 'package:kytypablo/Singletone/DataHolder.dart';

class TemperaturasView extends StatefulWidget{

  @override
  State<TemperaturasView> createState() => _TemperaturasViewState();
}

class _TemperaturasViewState extends State<TemperaturasView> {
  List<Map<String, dynamic>> capitalesYCoordenadas = [
    {"capital": "Washington D.C.", "latitud": 38.9072, "longitud": -77.0369,"url":"data:image/png;base64,"},
    {"capital": "Beijing", "latitud": 39.9042, "longitud": 116.4074,"url":"data:image/jpeg;base64,"},
    {"capital": "Moscú", "latitud": 55.7558, "longitud": 37.6173,"url":"data:image/png;base64,"},
    {"capital": "Tokio", "latitud": 35.6895, "longitud": 139.6917,"url":"data:image/jpeg;base64,"},
    {"capital": "Londres", "latitud": 51.5074, "longitud": -0.1278,"url":"data:image/png;base64,"},
    {"capital": "París", "latitud": 48.8566, "longitud": 2.3522,"url":"data:image/jpeg;base64,"},
    {"capital": "Berlín", "latitud": 52.5200, "longitud": 13.4050,"url":"data:image/png;base64,"},
    {"capital": "Nueva Delhi", "latitud": 28.6139, "longitud": 77.2090,"url":"data:image/jpeg;base64,"},
    {"capital": "Brasilia", "latitud": -15.7942, "longitud": -47.8822,"url":"data:image/png;base64,"},
    {"capital": "Ottawa", "latitud": 45.4215, "longitud": -75.6972,"url":"data:image/png;base64,"},
    {"capital": "Canberra", "latitud": -35.2809, "longitud": 149.1300,"url":"data:image/png;base64,"},
    {"capital": "Ciudad de México", "latitud": 19.4326, "longitud": -99.1332,"url":"data:image/jpeg;base64,"},
    {"capital": "Roma", "latitud": 41.9028, "longitud": 12.4964,"url":"data:image/png;base64,"},
    {"capital": "Madrid", "latitud": 40.4168, "longitud": -3.7038,"url":"data:image/png;base64,"},
    {"capital": "Seúl", "latitud": 37.5665, "longitud": 126.9780,"url":"data:image/png;base64,"},
    {"capital": "Yakarta", "latitud": -6.2088, "longitud": 106.8456,"url":"data:image/jpeg;base64,"},
    {"capital": "El Cairo", "latitud": 30.0444, "longitud": 31.2357,"url":"data:image/png;base64,"},
    {"capital": "Ankara", "latitud": 39.9334, "longitud": 32.8597,"url":"data:image/jpeg;base64,"},
    {"capital": "Buenos Aires", "latitud": -34.6037, "longitud": -58.3816,"url":"data:image/png;base64,"},
    {"capital": "Teherán", "latitud": 35.6892, "longitud": 51.3890,"url":"data:image/jpeg;base64,"},
  ];
  late List<double> temperaturas = [];

  @override
  void initState() {
    super.initState();
  }

  Future<List<double>> cargarTemperaturas() async {
    List<double> temperaturas = [];
    for (var ciudad in capitalesYCoordenadas) {
      double temperatura = await DataHolder().httpAdmin.pedirTiempoEn(ciudad["latitud"], ciudad["longitud"]);
      temperaturas.add(temperatura);
    }
    return temperaturas;
  }

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        title: Text("Capitales y Temperaturas"),
      ),
      body: FutureBuilder<List<double>>(
        future: cargarTemperaturas(),
        builder: (context, snapshot) {
          if (snapshot.connectionState == ConnectionState.waiting) {
            return Center(child: CircularProgressIndicator());
          } else if (snapshot.hasError) {
            return Center(child: Text("Error al cargar las temperaturas"));
          } else {
            List<double> temperaturas = snapshot.data!;
            return ListView.builder(
              itemCount: capitalesYCoordenadas.length,
              itemBuilder: (BuildContext context, int index) {
                var ciudad = capitalesYCoordenadas[index];
                return Padding(
                  padding: const EdgeInsets.all(8.0),
                  child: Row(
                    children: <Widget>[
                      Image.network(
                        ciudad["url"],
                        width: 50,
                        height: 50,
                      ),
                      SizedBox(width: 10),
                      Text("${ciudad["capital"]} -- Temperatura: ${temperaturas[index]}ºC"),
                    ],
                  ),
                );
              },
            );
          }
        },
      ),
    );
  }
}

